import React from 'react'
import Card from './Card'

const Movies = () => {
    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': 'b337bffaf8msh970dfd9b53b0620p1b64b4jsne08ea941d857',
            'X-RapidAPI-Host': 'online-movie-database.p.rapidapi.com'
        }
    };

    fetch('https://online-movie-database.p.rapidapi.com/auto-complete?q=<query>', options)
        .then(response => response.json())
        .then(response => console.log(response))
        .catch(err => console.error(err));
    return (
        <>
            <div className='main'>
                <div className='top'></div>
                <div className='middle'><Card /></div>
                <form>
                    <input type="text" id="filter" placeholder="Search for..." ref={input => this.search = input} onChange={this.handleInputChange} />
                </form>
            </div>
        </>
    )
}

export default Movies
